INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, 0.0, 106401, -363.0, 0.0, "2030/12/17 14:59:59", 13, "2015/12/17 15:00:00", 2104010, 0, 2, 1, 1, "シェフィ");
