INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001, 0.0, 106401, -363.0, 0.0, "2030/12/17 14:59:59", 16, "2015/12/17 15:00:00", 2104010, 0, 2, 1, 1, "シェフィ");
