INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001, 4.08, 109001, -385.0, 8.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 1, 2, "エリコ（バレンタイン）");
