INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, 10.11, 109001, -385.0, 8.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 3, 2, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004, 4.0, 109001, -385.0, 8.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 4, 2, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005, 6.0, 109001, -385.0, 8.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 5, 2, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, 0.0, 109002, 0.0, 0.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 6, 1, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, 0.0, 109002, 0.0, 0.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 7, 1, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, 0.0, 109002, 0.0, 0.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 8, 1, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009, 0.0, 109002, 0.0, 0.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 9, 1, "エリコ（バレンタイン）");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010, 0.0, 109002, 0.0, 0.0, "2030/12/17 14:59:59", 24, "2019/01/31 12:00:00", 0, 10011, 1, 10, 1, "エリコ（バレンタイン）");
